{"$content":[{"ID":"fest_022_001_dialog_english##_00_000","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"One day, you suddenly receive an invitation to a mysterious banquet.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_00_001","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"The sender is addressed to a Jake Stinchy, a name which is completely unfamiliar to you.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_00_002","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"Just as you think you'll be rejecting the invitation, an intoxicating scent wafts up from the parchment.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_00_003","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"You begin to feel light, as if your body is floating.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_00_004","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"It's a wonderful feeling...","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_01_000","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"When you come to, you've completely lost track of time. 

What's more, you seem to have accepted the invitation, finding yourself inside of a grand mansion.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_01_001","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"Suddenly, the mansion's towering front doors creak open, and dozens of new guests all holding the same invitation make their way inside.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_01_002","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"It seems you're not the only one confused here...","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_02_000","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"Welcome all of you to my humble abode. Shall we together enjoy a splendid evening?","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_02_001","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"I am your host, Jack Stinchy.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_02_002","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_sp1","IconLocate":2,"Text":"As for this mask, it's...","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_02_003","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"Well it's just something of a style choice. Don't pay it any mind.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_02_004","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"I've invited you all here tonight so that you may help me complete something of a task. A teensy, tiny little task.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_02_005","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"You see I've misplaced something of great importance to me somewhere in this mansion, and I can't seem to find it for the life of me...","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_03_000","SpeakerName":"Confused Guest","SpeakerAssetName":"CharacterName/h0088c4","IconName":"h0088c4_normal","IconLocate":2,"Text":"Now hold on, there was nothing written on my invitation! I never agreed to come here!","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_03_001","SpeakerName":"Scared Guest","SpeakerAssetName":"CharacterName/h0128c4","IconName":"h0128c4_normal","IconLocate":2,"Text":"I... I don't even know how I ended up here! I want to go home!","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_000","SpeakerName":"Scared Guest","SpeakerAssetName":"CharacterName/h0128c4","IconName":"h0128c4_normal","IconLocate":2,"Text":"Th-The door's locked!?","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_001","SpeakerName":"Confused Guest","SpeakerAssetName":"CharacterName/h0088c4","IconName":"h0088c4_normal","IconLocate":2,"Text":"What is the meaning of this!? Let us go, now!","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_002","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"Ohoho~ Don't worry, don't worry~
As long as you find what I've lost, then you can all go home.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_003","SpeakerName":"Scared Guest","SpeakerAssetName":"CharacterName/h0128c4","IconName":"h0128c4_normal","IconLocate":2,"Text":"What do you want us to look for, anyway?","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_004","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"Once you find everything, and return it to me, your question shall be answered.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_005","SpeakerName":"Confused Guest","SpeakerAssetName":"CharacterName/h0088c4","IconName":"h0088c4_normal","IconLocate":2,"Text":"And what if we can't find it?","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_006","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_sp1","IconLocate":2,"Text":"......","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_007","SpeakerName":"Jack","SpeakerAssetName":"CharacterName/h3371c4","IconName":"h3371c4_happiness","IconLocate":2,"Text":"I hope you all have a eventful night.","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_008","SpeakerName":"Confused Guest","SpeakerAssetName":"CharacterName/h0088c4","IconName":"h0088c4_normal","IconLocate":2,"Text":"You think if we don't find it... we'll be stuck here forever...?","sfxName":"","sfxVolume":1.0},{"ID":"fest_022_001_dialog_english##_04_009","SpeakerName":"Scared Guest","SpeakerAssetName":"CharacterName/h0128c4","IconName":"h0128c4_normal","IconLocate":2,"Text":"......","sfxName":"","sfxVolume":1.0}]}
